// Interior.jsx
import { useEffect } from 'react';
import { motion } from 'framer-motion';

const interiorImages = [
  '/images/interior1.jpg',
  '/images/interior2.jpg',
  '/images/interior3.jpg',
  '/images/interior4.jpg',
  '/images/interior5.jpg',
  '/images/interior6.jpg',
];

const cardVariants = {
  hidden: { opacity: 0, y: 30 },
  visible: (i) => ({
    opacity: 1,
    y: 0,
    transition: { delay: i * 0.2, duration: 0.6, ease: 'easeOut' },
  }),
};

const Interior = () => {
  useEffect(() => {
    window.scrollTo(0, 0);
  }, []);

  return (
    <div className="min-h-screen bg-black text-white pt-36 pb-16 px-6">
      <h1 className="text-4xl font-bold text-yellow-300 text-center mb-10">Interior Design Works</h1>
      <p className="text-lg text-center max-w-3xl mx-auto mb-12 text-gray-300">
        Explore our elegant and functional interior projectsâ€”from modern bedrooms to classy kitchens and efficient office spaces, we redefine interiors with creativity.
      </p>

      <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 gap-8 max-w-6xl mx-auto">
        {interiorImages.map((src, i) => (
          <motion.div
            key={i}
            custom={i}
            initial="hidden"
            animate="visible"
            variants={cardVariants}
            className="rounded-2xl overflow-hidden shadow-lg border border-yellow-300 hover:scale-105 transform transition duration-300 ease-in-out"
          >
            <img
              src={src}
              alt={`Interior ${i + 1}`}
              className="w-full h-64 object-cover hover:opacity-90 transition duration-300"
            />
          </motion.div>
        ))}
      </div>
    </div>
  );
};

export default Interior;
